8351BAA287044BFD83B5CD98A1850ACE	800001	fr_FR	0	0	Y	2013-11-13 12:32:48.252909	0	2013-11-13 12:32:48.252909	0	General Ledger Report	\N	"Créer un rapport montrant toutes les entrées du grand livre général regroupés par compte pour une période de temps spécifiée . Il est possible de grouper les résultats par le partenaire d'affaires, produit ou dimensions de la comptabilité de projet . Il est également possible de filtrer les résultats par une fourchette de montants , organisation , la gamme de comptes et une sélection de partenaires commerciaux, des produits et de la comptabilité des projets . de plus, il est possible de cacher la dette / Paiements correspondante,   Il existe 3 façons disponibles pour obtenir des résultats , le bouton de recherche et les exportations PDF et Excel.      Le bouton de recherche affiche le résultat dans la même fenêtre en utilisant la pagination, de sorte que vous devrez peut-être passer au suivant et précédent pages si le résultat a trop d'entrées . Le résultat est regroupé par la dimension comptable sélectionné ( s'il y en a sélectionné ) et par compte. Les entrées affichées sont triés par date de comptabilisation . Le montant précédent est la somme des montants de ce compte selon les dates sélectionnées avec la date comptable avant la plage de dates sélectionnée . Si les entrées d'un compte ne tient pas sur une page le montant représente la somme des montants qui sont présents sur la page , plus le solde précédent , dans ce cas, la page suivante l' inclura dans les montants précédents sera le montant de la précédente page.       L'exportation génère un fichier pdf pdf qui peut être imprimé ou stocké dans l'ordinateur pour les révisions ultérieures . Il a les mêmes règles de regroupement que le bouton de recherche. Dans ce cas, les sous-totaux sont la somme des montants non compris les montants d' équilibre initial .	Y
